-- ----------------------------
-- Table structure for `creature_templatewotlk`
-- ----------------------------
DROP TABLE IF EXISTS `creature_templatewotlk`;
CREATE TABLE `creature_templatewotlk` (
  `entry` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `exp` smallint(6) NOT NULL DEFAULT '0',
  `dmgschool` tinyint(4) NOT NULL DEFAULT '0',
  `BaseAttackTime` int(10) unsigned NOT NULL DEFAULT '0',
  `RangeAttackTime` int(10) unsigned NOT NULL DEFAULT '0',
  `BaseVariance` float NOT NULL DEFAULT '1',
  `RangeVariance` float NOT NULL DEFAULT '1',
  `unit_class` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `HealthModifier` float NOT NULL DEFAULT '1',
  `ManaModifier` float NOT NULL DEFAULT '1',
  `ArmorModifier` float NOT NULL DEFAULT '1',
  `DamageModifier` float NOT NULL DEFAULT '1',
  `ExperienceModifier` float NOT NULL DEFAULT '1',
  PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED COMMENT='Creature System';

-- ----------------------------
-- Records of creature_templatewotlk
-- ----------------------------

UPDATE creature_template
JOIN   creature_templatewotlk ON creature_template.entry = creature_templatewotlk.entry
SET    creature_template.exp = creature_templatewotlk.exp;

DROP TABLE IF EXISTS `creature_templatewotlk`;

UPDATE creature_template SET exp = "0" WHERE exp = "-1";